import React from "react";

export default function Interests() {
  return (
    <div className="interests">
      <h2 className="interests--title">Interests</h2>
      <p className="interests--para">
        Eos solet nullam ea, quaeque liberavisse pri eu. Eam an nihil persius
        albucius, vis minim dicit ut. Tale facer theophrastus pro no. Timeam
        appareat abhorreant ex vis, sed ut eius euismod adipisci. Per ad
        conceptam assueverit consectetuer.
      </p>
    </div>
  );
}
